import { BrowserRouter, Routes, Route } from 'react-router-dom';
import { ListaPedidos } from './pages/ListaPedidos';

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<ListaPedidos />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
